import React, { useState, useMemo } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider, createTheme, CssBaseline, Container, Box } from '@mui/material';
import Header from './components/Header.tsx';
import Hero from './components/Hero.tsx';
import About from './components/About.tsx';
import Experience from './components/Experience.tsx';
import Projects from './components/Projects.tsx';
import Skills from './components/Skills.tsx';
import Testimonials from './components/Testimonials.tsx';

const App: React.FC = () => {
  const [mode, setMode] = useState<'light' | 'dark'>('light');

  const theme = useMemo(
    () =>
      createTheme({
        palette: {
          mode,
          primary: {
            main: mode === 'light' ? '#2196f3' : '#90caf9',
            light: mode === 'light' ? '#64b5f6' : '#bbdefb',
            dark: mode === 'light' ? '#1976d2' : '#42a5f5',
          },
          secondary: {
            main: mode === 'light' ? '#f50057' : '#ff80ab',
            light: mode === 'light' ? '#ff4081' : '#ffb2dd',
            dark: mode === 'light' ? '#c51162' : '#c94f7c',
          },
          background: {
            default: mode === 'light' ? '#f8f9fa' : '#121212',
            paper: mode === 'light' ? '#ffffff' : '#1e1e1e',
          },
        },
        typography: {
          fontFamily: '"Poppins", "Roboto", "Helvetica", "Arial", sans-serif',
          h1: {
            fontWeight: 700,
            fontSize: '3.5rem',
            '@media (max-width:600px)': {
              fontSize: '2.5rem',
            },
          },
          h2: {
            fontWeight: 600,
            fontSize: '2.5rem',
            '@media (max-width:600px)': {
              fontSize: '2rem',
            },
          },
          h3: {
            fontWeight: 600,
            fontSize: '2rem',
            '@media (max-width:600px)': {
              fontSize: '1.75rem',
            },
          },
          h4: {
            fontWeight: 600,
            fontSize: '1.75rem',
            '@media (max-width:600px)': {
              fontSize: '1.5rem',
            },
          },
          h5: {
            fontWeight: 500,
            fontSize: '1.5rem',
            '@media (max-width:600px)': {
              fontSize: '1.25rem',
            },
          },
          h6: {
            fontWeight: 500,
            fontSize: '1.25rem',
            '@media (max-width:600px)': {
              fontSize: '1.1rem',
            },
          },
        },
        components: {
          MuiPaper: {
            styleOverrides: {
              root: {
                borderRadius: '16px',
                boxShadow: mode === 'light' 
                  ? '0 8px 32px rgba(0, 0, 0, 0.1)'
                  : '0 8px 32px rgba(0, 0, 0, 0.3)',
                transition: 'transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out',
                '&:hover': {
                  transform: 'translateY(-5px)',
                  boxShadow: mode === 'light'
                    ? '0 12px 40px rgba(0, 0, 0, 0.15)'
                    : '0 12px 40px rgba(0, 0, 0, 0.4)',
                },
              },
            },
          },
          MuiButton: {
            styleOverrides: {
              root: {
                borderRadius: '12px',
                textTransform: 'none',
                fontWeight: 500,
                padding: '10px 24px',
                transition: 'all 0.3s ease',
                '&:hover': {
                  transform: 'translateY(-2px)',
                },
              },
            },
          },
        },
      }),
    [mode],
  );

  const toggleColorMode = () => {
    setMode((prevMode) => (prevMode === 'light' ? 'dark' : 'light'));
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <Box
          sx={{
            minHeight: '100vh',
            background: mode === 'light' 
              ? `linear-gradient(135deg, rgba(255,255,255,0.1) 0%, rgba(255,255,255,0.05) 100%),
                 url('https://images.unsplash.com/photo-1555066931-4365d14bab8c?ixlib=rb-4.0.3&auto=format&fit=crop&w=1920&q=80')`
              : `linear-gradient(135deg, rgba(0,0,0,0.7) 0%, rgba(0,0,0,0.5) 100%),
                 url('https://images.unsplash.com/photo-1555066931-4365d14bab8c?ixlib=rb-4.0.3&auto=format&fit=crop&w=1920&q=80')`,
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            backgroundAttachment: 'fixed',
            position: 'relative',
            '&::before': {
              content: '""',
              position: 'absolute',
              top: 0,
              left: 0,
              right: 0,
              bottom: 0,
              background: mode === 'light' 
                ? 'rgba(255, 255, 255, 0.9)'
                : 'rgba(0, 0, 0, 0.85)',
              backdropFilter: 'blur(10px)',
              zIndex: 0,
            },
          }}
        >
          <Box sx={{ position: 'relative', zIndex: 1 }}>
            <Header onToggleTheme={toggleColorMode} themeMode={mode} />
            <Container 
              maxWidth="lg" 
              sx={{ 
                py: 4,
                '@media (max-width:600px)': {
                  px: 2,
                },
              }}
            >
              <Routes>
                <Route path="/" element={
                  <Box sx={{ display: 'flex', flexDirection: 'column', gap: 4 }}>
                    <Hero />
                    <About />
                    <Experience />
                    <Projects />
                    <Skills />
                    <Testimonials />
                  </Box>
                } />
                <Route path="/about" element={<About />} />
                <Route path="/experience" element={<Experience />} />
                <Route path="/projects" element={<Projects />} />
                <Route path="/skills" element={<Skills />} />
                <Route path="/testimonials" element={<Testimonials />} />
              </Routes>
            </Container>
          </Box>
        </Box>
      </Router>
    </ThemeProvider>
  );
};

export default App;
